import React, {
  useState,
  useEffect,
  useReducer,
  useLayoutEffect,
  useContext,
  useRef,
  memo,
  useMemo,
  useCallback
} from "react";
export default class MyCount extends React.Component {
  state = {
    count: 0
  };
  render() {
    return <span>{this.state.count}</span>;
  }
}
